    "content": "Jump to content From Wikipedia, the free encyclopedia Computer software that distributes web pages This article needs additional citations for verification. Please help improve this article by adding citations to reliable sources. Unsourced material may be challenged and removed. Find sources: \"Web server\" ‚Äì news ¬∑ newspapers ¬∑ books ¬∑ scholar ¬∑ JSTOR (March 2009) (Learn how and when to remove this message) PC clients communicating via the network with a web server serving static content only The inside and front of a Dell PowerEdge server, a computer designed to be mounted in a rack mount environment. Servers similar to this one are often used as web servers. Multiple web servers may be used for a high-traffic website. Server farm with thousands of web servers used for super-high traffic websites ADSL modem running an embedded web server serving dynamic web pages used for modem configuration A web server is computer software and underlying hardware that accepts requests via HTTP (the network protocol created to distribute web content) or its secure variant HTTPS. A user agent, commonly a web browser or web crawler, initiates communication by making a request for a web page or other resource using HTTP, and the server responds with the content of that resource or an error message. A web server can also accept and store resources sent from the user agent if configured to do so.[1][2][3][4][5] The hardware used to run a web server can vary according to the volume of requests that it needs to handle. At the low end of the range are embedded systems, such as a router that runs a small web server as its configuration interface. A high-traffic Internet website might handle requests with hundreds of servers that run on racks of high-speed computers.[6] A resource sent from a web server can be a pre-existing file (static content) available to the web server, or it can be generated at the time of the request (dynamic content) by another program that communicates with the server software. The former usually can be served faster and can be more easily cached for repeated requests, while the latter supports a broader range of applications. Technologies such as REST and SOAP, which use HTTP as a basis for general computer-to-computer communication, as well as support for WebDAV extensions, have extended the application of web servers well beyond their original purpose of serving human-readable pages. History [edit] First web proposal (1989) evaluated as \"vague but exciting...\" The world\u0027s first web server, a NeXT Computer workstation with Ethernet, 1990. The case label reads: \"This machine is a server. DO NOT POWER IT DOWN!!\" See also: History of the web browser, History of the World Wide Web, and History of the Internet This is a very brief history of web server programs, so some information necessarily overlaps with the histories of the web browsers, the World Wide Web and the Internet; therefore, for the sake of clarity and understandability, some key historical information below reported may be similar to that found also in one or more of the above-mentioned history articles.[7] Initial WWW project (1989‚Äì1991) [edit] In March 1989, Sir Tim Berners-Lee proposed a new project to his employer CERN, with the goal of easing the exchange of information between scientists by using a hypertext system. The proposal titled \"HyperText and CERN\", asked for comments and it was read by several people. In October 1990 the proposal was reformulated and enriched (having as co-author Robert Cailliau), and finally, it was approved.[8][9][10] Between late 1990 and early 1991 the project resulted in Berners-Lee and his developers writing and testing several software libraries along with three programs, which initially ran on NeXTSTEP OS installed on NeXT workstations:[11][12][10] a graphical web browser, called WorldWideWeb; a portable line mode web browser; a web server, later known as CERN httpd. Those early browsers retrieved web pages written in a simple early form of HTML from web servers using a new basic communication protocol that was named HTTP 0.9. In August 1991 Tim Berners-Lee announced the birth of WWW technology and encouraged scientists to adopt and develop it.[13] Soon after, those programs, along with their source code, were made available to people interested in their usage.[11] Although the source code was not formally licensed or placed in the public domain, CERN informally allowed users and developers to experiment and further develop on top of them. Berners-Lee started promoting the adoption and the usage of those programs along with their porting to other operating systems.[10] Fast and wild development (1991‚Äì1995) [edit] In December 1991, the first web server outside Europe was installed at SLAC (U.S.A.).[12] This was a very important event because it started trans-continental web communications between web browsers and web servers. In 1991‚Äì1993, CERN web server program continued to be actively developed by the w",
