    "title": "Windowing system - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia This article needs additional citations for verification. Please help improve this article by adding citations to reliable sources. Unsourced material may be challenged and removed. Find sources: \"Windowing system\" ‚Äì news ¬∑ newspapers ¬∑ books ¬∑ scholar ¬∑ JSTOR (December 2019) (Learn how and when to remove this message) Software that manages separately different parts of display screens Typical elements of a window. The window decoration is either drawn by the window manager or by the client. The drawing of the content is the task of the client. In computing, a windowing system (or window system) is a software suite that manages separately different parts of display screens.[1] It is a type of graphical user interface (GUI) which implements the WIMP (windows, icons, menus, pointer) paradigm for a user interface. Each currently running application is assigned a usually resizable and usually rectangular surface of the display to present its GUI to the user; these windows may overlap each other, as opposed to a tiling interface where they are not allowed to overlap. Usually a window decoration is drawn around each window. The programming of both the window decoration and of available widgets inside of the window, which are graphical elements for direct user interaction, such as sliders, buttons, etc., is eased and simplified through the use of widget toolkits. Technical details [edit] The main component of any windowing system is usually called the display server, although alternative terms such as window server are also in use. Any application that runs and presents its GUI in a window, is a client of the display server. The display server and its clients communicate with each other over an application programming interface (API) or a communications protocol, which is usually called display server protocol, the display server being the mediator between the clients and the user. It receives all the input from the kernel, that the kernel receives from all attached input devices, such as keyboard, pointing devices, or touchscreen and transmits it to the correct client. The display server is also responsible for the output of the clients to the computer monitor. The output of sound is usually not managed by the display server, but the sound volume is usually handled through GUI applets and it is the display server who decides which applications are on top. A windowing system enables the computer user to work with several programs at the same time. Each program presents its GUI in its own window, which is generally a rectangular area of the screen.[citation needed] From a programmer\u0027s point of view, a windowing system implements graphical primitives. For example: rendering fonts or drawing a line on the screen. It provides an abstraction of the graphics hardware for use by higher-level elements of the graphical interface such as a window manager.[citation needed] A display server protocol can be network capable or even network transparent, facilitating the implementation of thin clients.[citation needed] Display server [edit] The basic components of a GUI: The display server implements the windowing system. A simple window manager merely draws the window decorations, but compositing window managers do more. A display server or window server is a program whose primary task is to coordinate the input and output of its clients to and from the rest of the operating system, the hardware, and each other. The display server communicates with its clients over the display server protocol, a communications protocol, which can be network-transparent or simply network-capable. The display server is a key component in any graphical user interface, specifically the windowing system. The server/client relationship of a standalone display server is somewhat counterintuitive in that a \"server\" is usually thought of as a large, remote machine, whereas a standalone \"display server\" is a small local system, with most clients being executed on a larger central machine. The explanation is that a display server provides the services of a display and input devices. Display server communications protocols [edit] X11 [edit] Main articles: X Window System core protocol and X Window System The X.Org Server communicates with X clients (local or remote) and peripherals over the X11 protocol. X Window System logo The X Window System was first released in 1984 and is historically the main windowing system for Unix and Unix-like operating systems. The core protocol has been at version 11 since 1987, hence it commonly being known as \"X11\". The current reference implementation of the X11 protocol is the X.Org Server, which provides the display server and some ancillary components. The X Window System does not define a look and feel; instead, users run a window manager (either standalone or part of a broader desktop environment) and applications designed using a widget toolkit. The X.Org repositor",
